import React from 'react';
import Particles from 'react-tsparticles';

// Example images, replace these with your own image URLs or paths
import logoImage1 from '../images/js.png';
import logoImage2 from '../images/js.png';
import logoImage3 from '../images/js.png';

const ParticlesBackground = () => {
  return (
    <Particles
      id="tsparticles"
      options={{
        fullScreen: {
          enable: true,
          zIndex: -1  // Ensure it's behind other content
        },
        particles: {
          number: {
            value: 10,
            density: {
              enable: true,
              area: 800
            }
          },
          shape: {
            // type: 'image',
            // image: [
            //   { src: logoImage1, height: 20, width: 20 },
            //   { src: logoImage2, height: 20, width: 20 },
            //   { src: logoImage3, height: 20, width: 20 }
            // ]
            type: 'circle'
          },
          move: {
            enable: true,
            speed: 3,
            outModes: {
              default: 'out'
            }
          },
          opacity: {
            value: 0.8
          },
          size: {
            value: 30,
            random: true
          }
        }
      }}
    />
  );
};

export default ParticlesBackground;
